import React from 'react';
import './master.css';

function Banner() {

    return (
        <div className="banner-container">
        <div className="banner-image-overlay">
            <img className="banner-logo" src="../images/izzy-logo.png" alt="Izzy Logo"/>
            <img className="banner-overlay-logo" src="../images/izzy-logo-overlay-2.png" alt="Overlay Logo"/>
          </div>
        <div className="banner-header">
            <h1>Hi, my name is Izzy. I study engineering at Northestern.</h1>
        </div>
        </div>
    )
}

export default Banner;
